import React, { useEffect, useState } from 'react';
import homeCSS from '../home_genre_playlist.module.css';
import jackboys from '../assets/jackboys.png';
import Card from 'react-bootstrap/Card';

function SongCard () {

    return (
        <a>
        <Card className={homeCSS.card} style={{ width: '12rem' }}>
            <Card.Img variant="top" src={jackboys} className={homeCSS.cardImg} />
            <Card.Body>
                <Card.Title>Song 1</Card.Title>
                <Card.Text>
                    <p>Artist1</p>
                    <p>Genre1</p>
                </Card.Text>
            </Card.Body>
        </Card>
    </a>
    )
    

}

export default SongCard;
